import { Marca } from './../../models/marca.model';
import { MarcaService } from './../../marca.service';
import { Component, OnInit } from '@angular/core';
import {
  FormBuilder,
  FormControl,
  FormGroup,
  Validators,
} from '@angular/forms';
@Component({
  selector: 'gc-marca-create',
  templateUrl: './marca-create.component.html',
})
export class MarcaCreateComponent implements OnInit {
  sigla!: string;
  descricao!: string;
  constructor(private marcaService: MarcaService) {}
  ngOnInit(): void {
    throw new Error('Method not implemented.');
  }

  save() {
    const marca: Marca = {
      sigla: this.sigla,
      descricao: this.descricao,
    };
    this.marcaService.save(marca).subscribe(
      (res) => {
        console.log(res);
      },
      (error) => console.log(error)
    );
  }
}
<form (ngSubmit)="save()">
  <h2>Cadastro de curso</h2>
  <div>
    <label for="sigla">Nome</label>
    <input id="sigla" name="sigla" [(ngModel)]="sigla" type="text" />
  </div>
  <div>
    <label for="descricao">Descricao</label>
    <input
      id="descricao"
      name="descricao"
      [(ngModel)]="descricao"
      type="text"
    />
  </div>
  <button>Salvar</button>
</form>
